import React from "react";
import { Navigate } from "react-router-dom";
import HomeScreen from "../screens/HomeScreen";


export default function Contact() {
    return (
        <a href='/home/Contact' onClick={() => {
            Navigate(<Contact />)
        }}>
        SHOP
        </a>
    )
}
